import React, { useState } from 'react';
import { View, Text } from 'react-native';

import styles from './estilo';

export default function tRecentes(){
    return(
        <View style={styles.container}>
            <Text style={styles.title}>Pagina Recentes</Text>
        </View>
    );
}
